import React from "react";

function DataBody(props) {
    return (

        <li className="list-group-item">
            <img alt={props.name} className="img-fluid" src={props.picture} />
            <span>
                {props.name}
                {props.phone}
                {props.email}
                {props.dob}
            </span>
        </li>

    );
}

export default DataBody;
